import React from 'react';
import { motion } from 'framer-motion';

const ObjectImage = ({ object, handleClick }) => {
  return (
    <div className="object-container">
      <motion.button className="object-button">
        <img
          className="object"
          src={`${object % 4}.svg`}
          alt="object"
          onClick={handleClick}
        />
      </motion.button>
    </div>
  );
}

export default ObjectImage;
